import React from 'react'

const users = [
    { username: "User1"},
    { username: "User2" },
    { username: "User3" } 
]

const Room = () => {
  return (
    <div>
        {users.map( (user) => (<h3>{user.text}</h3>) )}
    </div>
  )
}

export default Room
